    const [dateRange,setDateRange] = useState([])
    const chooseDate = (date) =>{
        setDateRange
    }
    return (
        <Row>
            <div>
                Період
                <DateRangePicker
                    size="lg"
                    appearance="subtle"
                    placeholder="Оберіть період"
                    style={{ width: 200 }}
                    value={dateRange}
                    onChange={(e) => chooseDate(e.target.value)}
                >

                </DateRangePicker>
            </div>
        </Row>
    );
};

export default OrderFilter;
